function getTextInput(){
	text = document.getElementById("textinput").value;
	text = text.toLowerCase();
	if(text == ""){
		return null;
	}
    text_no_punc = text.match(/[^_\W]+/g).join(' ');
	words_array = text_no_punc.split(" ");
	return words_array;

}

function getEmbeddings(){
	words_array = getTextInput();
	if(words_array == null){
		console.log("ONE");
		return 
	}
	final_embeddings = null;
	pca_embeddings = null;

	var opt = {}
	opt.dim = 3; // dimensionality of the embedding (2 = default)
	opt.epsilon = 10; // epsilon is learning rate (10 = default)
	opt.perplexity = 30; // roughly how many neighbors each point influences (30 = default)
	var tsne = new tsnejs.tSNE(opt); // create a tSNE instance

	console.log("TWO");

	// Load the model.
	use.load().then(model => {
	  // Embed an array of sentences.
	  console.log("THREE");

	  const words = words_array;
	  model.embed(words).then(embeddings => {
	    // `embeddings` is a 2D tensor consisting of the 512-dimensional embeddings for each sentence.
	    // So in this example `embeddings` has the shape [2, 512].
	    embeddings.print(/* verbose */);

		// flatten array
		let arr = embeddings.dataSync()

		//convert to multiple dimensional array
		shape = embeddings.shape
		console.log("SHAPE")
		console.log(shape)
		shape.reverse().map(a => {
		  arr = arr.reduce((b, c) => {
		  latest = b[b.length - 1]
		  latest.length < a ? latest.push(c) : b.push([c])
		  return b
		}, [[]])
		})
	   

	    tsne.initDataRaw(arr[0]);
	    for(var k = 0; k < 500; k++) {
		  tsne.step(); // every time you call this, solution gets better
		}
		pca_embeddings = tsne.getSolution(); // Y is an array of 3-D points that you can plot

		var x = {};
		var y = {};
		var z = {};

		new_words_array = []

		for (var i = 0; i < words_array.length; i++){
			word = words_array[i];
			embedding = pca_embeddings[i];
			if (new_words_array.indexOf(word) < 0){
				new_words_array.push(word)
			}
			x_coord = embedding[0];
			y_coord = embedding[1];
			z_coord = embedding[2];
			x[word] = x_coord;
			y[word] = y_coord;
			z[word] = z_coord;
		}

		setCurrentVariables(new_words_array, x, y, z);
		showVizualization();
	  });
	});



}

function getEuclideanDistance(word1, word2) {
	var sum = Math.pow(getPositionX(word1) - getPositionX(word2), 2) + Math.pow(getPositionY(word1) - getPositionY(word2), 2) + Math.pow(getPositionZ(word1) - getPositionZ(word2), 2);
	return Math.sqrt(sum)
}

function getEuclideanDistanceCoords(coords, word2) {
	var sum = Math.pow(coords[0] - getPositionX(word2), 2) + Math.pow(coords[1] - getPositionY(word2), 2) + Math.pow(coords[2] - getPositionZ(word2), 2);
	return Math.sqrt(sum)
}

function findDistance(word1, word2) {
	var dist_result;

	// Check words exists in embeddings
	if (!current_words.includes(word1) || !current_words.includes(word2)) {
		dist_result = word1 + " and/or " + word2 + " do not exist in the graph. Please try another word."
	} else {
		dist = getEuclideanDistance(word1, word2);
		dist_result = "The distance between " + word1 + " and " + word2 + " is: " + dist + "."
	}

	document.getElementById("dist_result").innerHTML = dist_result;
	document.getElementById("find_dist_result").style.display = "inline";
	showVizualization(main_word = null, targetValues = [word1, word2]);
}

